  "inlineSchema": "// Datasource & Generator\ngenerator client {\n  provider = \"prisma-client-js\"\n}\n\ndatasource db {\n  provider = \"postgresql\"\n  url      = env(\"DATABASE_URL\")\n}\n\n// Enums\nenum UserStatus {\n  Active\n  Inactive\n}\n\nenum TaskStatus {\n  NotStarted\n  InProgress\n  Completed\n  Overdue\n}\n\nenum TaskPriority {\n  Critical\n  High\n  Medium\n  Low\n}\n\nenum PermissionLevel {\n  full\n  edit\n  view\n  none\n}\n\nenum RecurrencePatternType {\n  daily\n  weekly\n  monthly\n  custom\n}\n\nenum RecurrenceEndCondition {\n  never\n  after\n  onDate\n}\n\nenum TrainingStatus {\n  Upcoming\n  Completed\n  Cancelled\n}\n\nenum PaymentStatus {\n  Scheduled\n  Pending\n  Paid\n  Overdue\n}\n\n// 1. User\nmodel User {\n  id           String     @id @default(uuid()) @db.Uuid\n  email        String     @unique\n  name         String\n  avatarUrl    String?\n  status       UserStatus @default(Active)\n  passwordHash String?\n\n  // relations\n  roles         UserRole[]\n  tasksAssigned Task[]        @relation(\"TaskAssignee\")\n  tasksCreated  Task[]        @relation(\"TaskCreator\")\n  taskComments  TaskComment[]\n  trainings     Training[]    @relation(\"TrainingFacilitator\")\n  paymentPlans  PaymentPlan[] @relation(\"PlanCreator\")\n  expenses      Expense[]     @relation(\"ExpenseCreator\")\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@index([status])\n}\n\n// 2. Role\nmodel Role {\n  id          String       @id @default(uuid()) @db.Uuid\n  name        String       @unique\n  users       UserRole[]\n  permissions Permission[]\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n}\n\n// 3. UserRole (junction)\nmodel UserRole {\n  userId String @db.Uuid\n  roleId String @db.Uuid\n\n  user User @relation(fields: [userId], references: [id])\n  role Role @relation(fields: [roleId], references: [id])\n\n  createdAt DateTime @default(now())\n\n  @@id([userId, roleId])\n  @@index([roleId])\n}\n\n// 4. Module\nmodel Module {\n  id          String       @id @default(uuid()) @db.Uuid\n  name        String       @unique\n  permissions Permission[]\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n}\n\n// 5. Permission (role x module)\nmodel Permission {\n  id       String          @id @default(uuid()) @db.Uuid\n  roleId   String          @db.Uuid\n  moduleId String          @db.Uuid\n  level    PermissionLevel\n\n  role   Role   @relation(fields: [roleId], references: [id])\n  module Module @relation(fields: [moduleId], references: [id])\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@unique([roleId, moduleId])\n  @@index([moduleId])\n}\n\n// 6. Task\nmodel Task {\n  id           String       @id @default(uuid()) @db.Uuid\n  name         String\n  description  String?\n  assigneeId   String?      @db.Uuid\n  dueDate      DateTime\n  status       TaskStatus   @default(NotStarted)\n  priority     TaskPriority @default(Medium)\n  isRecurring  Boolean      @default(false)\n  parentTaskId String?      @db.Uuid\n  createdById  String?      @db.Uuid\n\n  assignee         User?             @relation(\"TaskAssignee\", fields: [assigneeId], references: [id])\n  creator          User?             @relation(\"TaskCreator\", fields: [createdById], references: [id])\n  parentTask       Task?             @relation(\"TaskParent\", fields: [parentTaskId], references: [id])\n  childTasks       Task[]            @relation(\"TaskParent\")\n  comments         TaskComment[]\n  recurringPattern RecurringPattern?\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@index([assigneeId])\n  @@index([dueDate])\n  @@index([status])\n  @@index([priority])\n}\n\n// 7. TaskComment\nmodel TaskComment {\n  id       String @id @default(uuid()) @db.Uuid\n  taskId   String @db.Uuid\n  authorId String @db.Uuid\n  text     String\n\n  task   Task @relation(fields: [taskId], references: [id])\n  author User @relation(fields: [authorId], references: [id])\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@index([taskId])\n  @@index([authorId])\n}\n\n// 8. RecurringPattern (1:1 Task)\nmodel RecurringPattern {\n  id           String                 @id @default(uuid()) @db.Uuid\n  taskId       String                 @unique @db.Uuid\n  pattern      RecurrencePatternType\n  interval     Int                    @default(1)\n  daysOfWeek   Int[]                  @default([])\n  endCondition RecurrenceEndCondition @default(never)\n  occurrences  Int?\n  endDate      DateTime?\n\n  task Task @relation(fields: [taskId], references: [id])\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n}\n\n// 9. Budget (category)\nmodel Budget {\n  id          String  @id @default(uuid()) @db.Uuid\n  name        String\n  totalBudget Decimal @db.Decimal(12, 2)\n  fiscalYear  Int\n\n  paymentPlans PaymentPlan[]\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@index([fiscalYear])\n}\n\n// 10. PaymentPlan\nmodel PaymentPlan {\n  id          String        @id @default(uuid()) @db.Uuid\n  planName    String\n  budgetId    String?       @db.Uuid\n  amount      Decimal       @db.Decimal(12, 2)\n  dueDate     DateTime\n  description String?\n  vendor      String?\n  status      PaymentStatus @default(Scheduled)\n  createdById String?       @db.Uuid\n\n  budget    Budget?   @relation(fields: [budgetId], references: [id])\n  createdBy User?     @relation(\"PlanCreator\", fields: [createdById], references: [id])\n  expenses  Expense[]\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@index([budgetId])\n  @@index([status])\n}\n\n// 11. Expense (payment)\nmodel Expense {\n  id              String   @id @default(uuid()) @db.Uuid\n  planId          String?  @db.Uuid\n  amount          Decimal  @db.Decimal(12, 2)\n  paymentDate     DateTime\n  paymentMethod   String?\n  vendor          String?\n  description     String?\n  receiptFilename String?\n  receiptUrl      String?\n  notes           String?\n  createdById     String?  @db.Uuid\n\n  plan      PaymentPlan? @relation(fields: [planId], references: [id])\n  createdBy User?        @relation(\"ExpenseCreator\", fields: [createdById], references: [id])\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@index([planId])\n  @@index([paymentDate])\n}\n\n// 12. Farmer\nmodel Farmer {\n  id               String   @id @default(uuid()) @db.Uuid\n  farmerCode       String   @unique\n  name             String\n  location         String?\n  contactPhone     String?\n  contactEmail     String?\n  landSizeHectares Decimal? @db.Decimal(8, 2)\n  yearGroup        Int?\n  status           String?  @default(\"Active\")\n  baselineIncome   Decimal? @db.Decimal(12, 2)\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@index([yearGroup])\n}\n\n// 13. Training (session)\nmodel Training {\n  id            String         @id @default(uuid()) @db.Uuid\n  topic         String\n  description   String?\n  date          DateTime\n  location      String?\n  facilitatorId String?        @db.Uuid\n  capacity      Int?\n  status        TrainingStatus @default(Upcoming)\n\n  facilitator User? @relation(\"TrainingFacilitator\", fields: [facilitatorId], references: [id])\n\n  createdAt DateTime @default(now())\n  updatedAt DateTime @updatedAt\n\n  @@index([date])\n  @@index([facilitatorId])\n}\n",
